import ReactDOM from "react-dom";
import {BrowserRouter} from "react-router-dom";
import "./index.css";
import App from "./App";

export const UserContext = createContext();
const [user, setUser] = useState({});

ReactDOM.render(
  <BrowserRouter>
    <UserContext.Provider>
      <App/>
    </UserContext.Provider>
  </BrowserRouter>,
  document.getElementById("root")
);
